import React from "react";
import "../index.css"; // 필요 시 스타일 유지

const MyJourney = () => {
  return (
    <div className="my-journey-container" style={{ padding: "2rem", lineHeight: "1.8" }}>
      <h1>🌌 My Journey</h1>
      <p>
        어릴 적, 나는 천문학자가 되고 싶었다. <br />
        그냥 천문학자가 아니라, 영화 <i>Contact</i>의 '엘리'처럼 되고 싶었다. <br />
        외계에서 오는 신호를 해독하고, 우주를 여행하는 그런 삶...
        {/* 중략: 전체 본문은 아까 작성한 한국어 에세이 전체 복붙 가능 */}
      </p>
    </div>
  );
};

export default MyJourney;
